import React, {Component} from 'react';



class Fetchpokemon extends Component {

   constructor(){
   	super();
   	this.state = {
   		pokemonid:[]
   	}
   }

   componentDidMount(){
   	console.log(this.props.urls);
	this.props.urls.forEach((url)=>{
		fetch(url)
		.then(resp => resp.json())
		.then(info => console.log(info.id));
	})
   }

   render(){


	return 1;
}
}











